DESCRIPTION

FETISH F*CK DOLLS 2 finds the notorious Jake Malone at the top of his form, blurring the line between sadomasochistic fetish and straight-out f*cking to its most exciting and shocking place yet. The Man With the Black Glove enlists the most crazed, eager to debase and be debased whores from Europe and the San Fernando Valley and putting them through creative and merciless gauntlets at the hands of a small army of brutal super-studs. Featured are Annette Schwarz, Codi Carmichael, Velicity Von, Olga Cabaeva, and Charlotte Vale. The disc includes photo galleries, trailers, and a 16-minute behind-the-scenes featurette.
